define([
    'react/addons',
    'lodash'
], function (React, _) {
    'use strict';
    function onMouseDown1(data, evt) {
        data.value = 'event did happen though it should not';
    }
    function onClick2(data) {
        data.value = 'event did happen though it should not';
    }
    function scopeData3() {
        var data = { value: 'event did not happen because onClick not called' };
        return React.createElement('div', {
            'onMouseDown': onMouseDown1.bind(this, data),
            'onClick': onClick2.bind(this, data)
        }, '\n    ', data.value, '\n');
    }
    return function () {
        return scopeData3.apply(this, []);
    };
});